import Styled from 'styled-components';
import { Checkbox } from 'antd';

const CheckboxStyle = Styled(Checkbox)`
.ant-checkbox-checked {
    &:after {
      border-color: ${({ theme }) => theme['success-color']};
    }
`;

export { CheckboxStyle };
